import React, {Component} from 'react'
import 'bootstrap/dist/css/bootstrap.min.css'

class AddTeacherBtn extends Component {
    render() {
        return (
            <div className="row">
                <div className="col-xl-2 col-md-4 col-sm-4 col-6" style={logoStyle}>
                    <button type="button" className="btn btn-dark btn-lg" style={btn}>Додати Вчителя</button>
                </div>
            </div>
        )
    }
}
const logoStyle = {
    position: 'fixed',
    bottom: '0',
    left: '0',
    paddingTop: '3px',
    margin: '10px',
    marginBottom: '15px'
}
const btn = {
    width: '100%',
    textDecoration: 'underline',
    fontWeight: 'bold'
}
export default AddTeacherBtn
